function analyze() {
  const text = document.getElementById("entry").value;
  if (text) {
    fetch("https://api.openai.com/v1/language/engines/davinci-codex/completions", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
        "Authorization": "Bearer API_KEY"
      },
      body: JSON.stringify({
        prompt: `Analyze the following text: "${text}"`,
        max_tokens: 60,
        n: 1,
        stop: ["Q:"],
        temperature: 0.5
      })
    })
      .then(response => response.json())
      .then(data => {
        const result = data.choices[0].text.trim();
        document.getElementById("analysisResults").innerHTML = `Analysis: ${result}`;
      })
      .catch(error => console.log(error));
  } else {
    alert("Please enter some text");
  }
}

function clearInput() {
  document.getElementById("entry").value = "";
  document.getElementById("analysisResults").innerHTML = "";
}

