let currentOperation = '0';
let previousOperation = '';
let operatorSelected = false;
let result = 0;
let currentOperator = '';

const screen = document.querySelector('.screen');
const currentOpEl = document.querySelector('.current-operation');
const prevOpEl = document.querySelector('.previous-operation');
const btns = document.querySelectorAll('.btn');
const numberBtns = document.querySelectorAll('.number');
const operatorBtns = document.querySelectorAll('.operator');
const clearBtn = document.querySelector('.clear');
const equalsBtn = document.querySelector('.equals');

numberBtns.forEach(btn => {
  btn.addEventListener('click', () => {
    if (currentOperation === '0' || operatorSelected) {
      currentOperation = btn.textContent;
      operatorSelected = false;
    } else if (currentOperation.length < 10) {
      currentOperation += btn.textContent;
    }
    updateScreen(currentOperation);
  });
});

operatorBtns.forEach(btn => {
  btn.addEventListener('click', () => {
    if (currentOperation !== '0') {
      calculate();
      currentOperator = btn.textContent;
      previousOperation = currentOperation + ' ' + currentOperator;
      currentOperation = '';
      operatorSelected = true;
      updateScreen(currentOperation);
      prevOpEl.textContent = previousOperation;
    }
  });
});

equalsBtn.addEventListener('click', () => {
  if (currentOperation !== '' && currentOperator !== '') {
    calculate();
    prevOpEl.textContent = '';
    updateScreen(result.toFixed(2));
  }
});

clearBtn.addEventListener('click', () => {
  currentOperation = '0';
  previousOperation = '';
  operatorSelected = false;
  result = 0;
  currentOperator = '';
  updateScreen(currentOperation);
  prevOpEl.textContent = '';
});

function calculate() {
  switch(currentOperator) {
    case '÷':
      result = result === 0 ? parseFloat(currentOperation) : result / parseFloat(currentOperation);
      break;
    case '×':
      result = result === 0 ? parseFloat(currentOperation) : result * parseFloat(currentOperation);
      break;
    case '-':
      result = result === 0 ? parseFloat(currentOperation) : result - parseFloat(currentOperation);
      break;
    case '+':
      result = result === 0 ? parseFloat(currentOperation) : result + parseFloat(currentOperation);
      break;
  }
}

function updateScreen(value) {
  currentOpEl.textContent = value;
}

