const display = document.querySelector('.display');
const buttons = document.querySelectorAll('.button');

let currentValue = '';
let previousValue = '';
let operator = null;

function clear() {
  currentValue = '';
}

function toggleNegative() {
  if (currentValue) {
    if (currentValue[0] === '-') {
      currentValue = currentValue.slice(1);
    } else {
      currentValue = '-' + currentValue;
    }
  }
}

function addPercent() {
  if (currentValue) {
    currentValue = parseFloat(currentValue) / 100;
  }
}

function handleOperator(nextOperator) {
  const currentValueFloat = parseFloat(currentValue);
  if (operator && previousValue) {
    const previousValueFloat = parseFloat(previousValue);
    switch (operator) {
      case '+':
        previousValue = previousValueFloat + currentValueFloat;
        break;
      case '-':
        previousValue = previousValueFloat - currentValueFloat;
        break;
      case '*':
        previousValue = previousValueFloat * currentValueFloat;
        break;
      case '/':
        previousValue = previousValueFloat / currentValueFloat;
        break;
      default:
        previousValue = currentValue;
    }
    currentValue = '';
    display.innerText = previousValue;
  } else if (currentValue) {
    previousValue = currentValue;
    currentValue = '';
    display.innerText = previousValue;
  }
  operator = nextOperator;
}

function calculate() {
  if (currentValue && previousValue && operator) {
    const currentValueFloat = parseFloat(currentValue);
    const previousValueFloat = parseFloat(previousValue);
    switch (operator) {
      case '+':
        currentValue = previousValueFloat + currentValueFloat;
        break;
      case '-':
        currentValue = previousValueFloat - currentValueFloat;
        break;
      case '*':
        currentValue = previousValueFloat * currentValueFloat;
        break;
      case '/':
        currentValue = previousValueFloat / currentValueFloat;
        break;
      default:
        currentValue = '';
    }
    previousValue = '';
    operator = null;
    display.innerText = currentValue;
  }
}

function handleButton(event) {
  const button = event.target;
  const buttonValue = button.dataset.value;
  switch (buttonValue) {
    case 'C':
      clear();
      display.innerText = '';
      break;
    case '±':
      toggleNegative();
      display.innerText = currentValue;
      break;
    case '%':
      addPercent();
      display.innerText = currentValue;
      break;
    case '+':
      handleOperator(buttonValue);
      break;
    case '-':
      handleOperator(buttonValue);
      break;
    case '*':
      handleOperator(buttonValue);
      break;
    case '/':
      handleOperator(buttonValue);
      break;
    case '=':
      calculate();
      break;
    default:
      if (buttonValue) {
        currentValue += buttonValue;
        display.innerText = currentValue;
      }
  }
}

buttons.forEach(button => {
  button.addEventListener('click', handleButton);
});

